import React from 'react';

const PartElem = () => {
    return (
        <div className="part_shadow">
            <img src="https://via.placeholder.com/310x200"/>
            <div className="main_cont_info">
                <div className="main_cont_title">
                    <div className="main_cont_text">Alphard Group
                    </div>
                </div>
                <div className="main_cont_desc">
                    <div className="main_cont_desc_title">Описание
                    </div>
                    <div className="main_cont_desc_text">Компания
                        «Alphard Group, LLC» образована в 2000г. в Польше и специализируется на выпуске
                        профессиональной и автомобильной акустики, усилителей, микрофонов. Несмотря на то,
                        что Alphard появился на рынке акустики относительно недавно, продукция, производимая
                        под этим брэндом имеет множество наград.
                    </div>
                </div>
            </div>
        </div>
    );
};

export default PartElem;
